webpackJsonp([97810840346436],{927:function(e,a){e.exports={data:{allMarkdownRemark:{edges:[{node:{excerpt:"Abstract Online information is the modern tool of choice for individuals trying to learn and make decisions around complex subjects, but it is becoming increasingly challenging for them to make sense of it. The complex and messy process of…",fields:{slug:"/research/distil/",imgPath:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.7298225529479108,src:"/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-7c9e1.png",srcSet:"/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-68f83.png 75w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-24538.png 150w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-7c9e1.png 300w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-51cd9.png 450w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-14a3d.png 600w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-fdea3.png 900w,\n/static/Notes Board-62dedc655baa15c3b6978a283e2bd0a1-7dc11.png 3022w",sizes:"(max-width: 300px) 100vw, 300px"}}},docPath:"/research/distil/distil.pdf"},id:"/Users/nhahn/Research/PersonalSite/src/pages/research/distil/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Distil",date:"April 05, 2018",summary:"Distil helps people capture and organize the information they collect from their online searches. It allows for multiple, flexible capture technique and an iterative development of an organization without all the manual work. It's currently built as a Chrome extension, and will eventually be integrated with Bento",tags:["Sensemaking","Synthesis","Interaction Techniques","Annotation"],authors:["Nathan Hahn","Joseph Chang","Emily Su","Ben Stein","Niki Kittur"],conference:"UIST 2018 (in Submission)",award:null}}},{node:{excerpt:"Abstract Whether figuring out where to eat in an unfamiliar city or deciding which college to attend, large collections of consumer generated data (i.e. reviews and forum posts) are an important influence in online decision making. To make sense of…",fields:{slug:"/research/searchlens/",imgPath:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.3971291866028708,src:"/static/main-d7f36176351797ac443c7cbdde12da50-7c9e1.png",srcSet:"/static/main-d7f36176351797ac443c7cbdde12da50-68f83.png 75w,\n/static/main-d7f36176351797ac443c7cbdde12da50-24538.png 150w,\n/static/main-d7f36176351797ac443c7cbdde12da50-7c9e1.png 300w,\n/static/main-d7f36176351797ac443c7cbdde12da50-51cd9.png 450w,\n/static/main-d7f36176351797ac443c7cbdde12da50-14a3d.png 600w,\n/static/main-d7f36176351797ac443c7cbdde12da50-fdea3.png 900w,\n/static/main-d7f36176351797ac443c7cbdde12da50-23a6d.png 1460w",sizes:"(max-width: 300px) 100vw, 300px"}}},docPath:"/research/searchlens/searchlens.pdf"},id:"/Users/nhahn/Research/PersonalSite/src/pages/research/searchlens/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"SearchLens",date:"April 02, 2018",summary:'SearchLens is a replacement search interface for exploratory searches, where users might have multiple categories or criteria they need to fulfil. By building up "lenses", users can easily structure what they want into a query, assign weights, and then see how results matched their preferences.',tags:["Sensemaking","Information Retrieval"],authors:["Joseph Chang","Nathan Hahn","Adam Peerer","Niki Kittur"],conference:"UIST 2018 (in Submission)",award:null}}},{node:{excerpt:"Abstract Whether planning a trip or researching medical symptoms, many complex and exploratory search tasks involve intense cross referencing of multiple sources. One has to determine the popularity and trustworthiness of competing options and avoid…",fields:{slug:"/research/searchscape/",imgPath:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2.6752827140549273,src:"/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-7c9e1.png",srcSet:"/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-68f83.png 75w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-24538.png 150w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-7c9e1.png 300w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-51cd9.png 450w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-14a3d.png 600w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-fdea3.png 900w,\n/static/main-1cb436eb61e765ef5b8f2f5c5f3e2193-61554.png 3312w",sizes:"(max-width: 300px) 100vw, 300px"}}},docPath:"/research/searchscape/searchscape.pdf"},id:"/Users/nhahn/Research/PersonalSite/src/pages/research/searchscape/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"SearchScape",date:"April 01, 2018",summary:"We've been working on the concept of \"casual microtasking\", or giving people small tasks to work on while they're doing other activities. In this paper, we explored this with Facebook -- we inserted small writing tasks into users' Facebook news feed, and gathered some responses about their experience with it.",tags:["Sensemaking","Information Retrieval","Machine Learning"],authors:["Joseph Chang","Nathan Hahn","Niki Kittur"],conference:null,award:null}}},{node:{excerpt:"Abstract Microtasks make it possible for people with limited time and context to contribute to a larger task. In this paper we explore casual microtasking, where microtasks are embedded into other primary activities so that they are available to be…",fields:{slug:"/research/playwrite/",imgPath:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2.0444839857651247,src:"/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-7c9e1.png",srcSet:"/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-68f83.png 75w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-24538.png 150w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-7c9e1.png 300w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-51cd9.png 450w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-14a3d.png 600w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-fdea3.png 900w,\n/static/Overview-01-b2d1f537f16bdfe0c144bc2850ad1b00-224d5.png 1149w",sizes:"(max-width: 300px) 100vw, 300px"}}},docPath:"/research/playwrite/microtasking.pdf"},id:"/Users/nhahn/Research/PersonalSite/src/pages/research/playwrite/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Casual Microtasking",date:"March 31, 2018",summary:"We've been working on the concept of \"casual microtasking\", or giving people small tasks to work on while they're doing other activities. In this paper, we explored this with Facebook -- we inserted small writing tasks into users' Facebook news feed, and gathered some responses about their experience with it.",tags:["Mircotasks","Selfsourcing"],authors:["Nathan Hahn","Shamsi Iqbal","Jaime Teevan"],conference:"UIST 2018 (in Submission)",award:null}}},{node:{excerpt:"Abstract Tabs have become integral to browsing the web yet have changed little since their introduction nearly 20 years ago. In contrast, the internet has gone through dramatic changes, with tasks increasingly moving from the desktop to  the cloud…",fields:{slug:"/research/tabhoarders/",imgPath:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2.2603333333333335,src:"/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-7c9e1.png",srcSet:"/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-68f83.png 75w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-24538.png 150w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-7c9e1.png 300w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-51cd9.png 450w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-14a3d.png 600w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-fdea3.png 900w,\n/static/study1_v3QT-7bb2462953fe5703c04f6395c1b09f13-22f50.png 6781w",sizes:"(max-width: 300px) 100vw, 300px"}}},docPath:"/research/tabhoarders/tabhoarders.pdf"},id:"/Users/nhahn/Research/PersonalSite/src/pages/research/tabhoarders/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"TabHoarders",date:"March 30, 2018",summary:'Tabs are a central tool in user\'s web browsing toolkit for managing both their inter and intra task activities. We explore how those tabs break down as they struggle to support too many activities, resulting in a set of cognitive "pressures" that can cause frustration, overload and even shame.',tags:["Sensemaking","Information Retrieval"],authors:["Joseph Chang","Nathan Hahn","Niki Kittur"],conference:null,award:null}}}]}},pathContext:{}}}});
